import ParentIdField from "./ParentIdField/ParentIdField"

import EventField from "./EventField/EventField"
import RRulesField from "./EventField/RRulesField"
import RRulesFieldModel from "./EventField/RRulesField.model"

import ByDayWidget from "./EventField/ByDayWidget"
import ByMonthWidget from "./EventField/ByMonthWidget"
import ByMonthDayWidget from "./EventField/ByMonthDayWidget"

import MeasureField from "./MeasureField/MeasureField"
import MeasureFieldModel from "./MeasureField/MeasureField.model"

import SectionLayout from "./Section/SectionLayout"


export default {
    "fields": {
        "parentId": ParentIdField,
        "event": EventField,
        "rrules": RRulesField,
        "measure": MeasureField
    },
    "layouts": {
    },
    "widgets": {
        "byDay": ByDayWidget,
        "byMonth": ByMonthWidget,
        "byMonthDay": ByMonthDayWidget
    },
    "models": {
        "rrules": RRulesFieldModel,
        "measure": MeasureFieldModel
    }
}
